sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new OciObjectStorageManagementUtils();
    utils.validateInputVariables(inputs, outputs);
  	utils.validateMandatoryVariables(inputs,["namespace","bucketname"]);
    utils.maptoOutputFromInput(inputs, outputs, ["namespace","bucketname"]);
  	var requestBody = {
  "sourceObjectName": inputs.objectname,
  "destinationRegion": inputs.destination_region,
  "destinationNamespace": inputs.destination_namespace,
  "destinationBucket": inputs.destination_bucket,
  "destinationObjectName": inputs.destination_object,
}
    outputs.payload = JSON.stringify(requestBody);
  })(inputs, outputs);

